import React from 'react'
import Nav from './Nav'
import { Content } from '../Styles/global';
import Footer from './Footer';
import {ThreeDots} from 'react-loader-spinner';

function Loading(props) {
    const message = props.message;
  return (
    <div>
        <Nav />
        <Content>
          <ThreeDots
            color="white"
            height={100}
            width={100}

          />
          <h1>{message}</h1>
        </Content>
        <Footer />
    </div>
  )
}

export default Loading;
